  03> HUNT, Julie Elizabeth
  b 27.04.1969
  Address: 3/19 Glenview Street, Greenwich, NSW 2065, Australia.
  Julie has a Diploma in Graphic Art and Photography from Nepean College of Advanced Education, NSW.
  She has worked in the field of photography, graphic design and exhibition display. She travelled
  in South America for seven months. She is currently working in the printing industry.
