  01> NELSON, Saffron Rachel and BENNETT, Simon R
  b 16.04.1972
  Saffron b. at London, England. Address: 25/14 Watson Street, Neutral Bay 2089, NSW, Australia.
  Saffron emigrated to Sydney, Australia, at eight months. She grew up on a seven-acre hobby farm in
  West Pennant Hills and completed her secondary schooling at Ascham School, Edgecliff, then
  graduated with a Bachelor of Engineering (Aeronautical) from the University of Sydney in 1996. At
  university, she was active in extra-curricular activities and was the president of Aeronautical
  Engineering Social club as well as co-editor of the year book.
  After graduation Saffron travelled throughout the USA and Europe until coming back to Australia and
  accepting a position with the Department of Defence in Canberra in March 1997. She lived in
  Canberra while working on Tank Simulators for the Australia Army. At the completion of this
  "rotation", She was transferred to work back in Sydney at Boeing in North Ryde on the integration
  of GPS into various military aircraft. During this time she was offered a contract position in the
  Structures Engineering Division at QANTAS Airways where she has worked since January 1998.
  Saffron is a keen skier, snorkler and sailor and has competed in Sydney Harbour yacht racing as
  well as represented her University in downhill skiing competitions. She also has a great interest
  in flying.
